import React from 'react';

export default function NavBar(){
  return (
    <nav className="bg-white shadow-md">
      <div className="container mx-auto px-4 py-3 flex items-center justify-between">
        <div className="text-xl font-bold">ஈழிசை</div>
        <div className="space-x-4 hidden md:block">
          <a href="#" className="hover:text-indigo-600">முகப்புப் பக்கம்</a>
          <a href="#" className="hover:text-indigo-600">பற்றி</a>
          <a href="#" className="hover:text-indigo-600">படிப்புகள்</a>
          <a href="#" className="hover:text-indigo-600">நிகழ்வுகள்</a>
          <a href="#" className="hover:text-indigo-600">தொடர்பு</a>
        </div>
      </div>
    </nav>
  );
}
